package comp533.slave;

import comp533.barrier.TokenCounterBarrier;
import comp533.joiner.Joiner;
import comp533.keyValue.KeyValue;
import comp533.model.TokenCounterModel;
import comp533.partitioner.TokenCounterPartitioner;
import comp533.partitioner.TokenCounterPartitionerFactory;
import comp533.reducer.ReducerFactory;
import comp533.reducer.ReducerInterface;
import gradingTools.comp533s19.assignment0.AMapReduceTracer;
import util.trace.Tracer;

import java.util.ArrayList;
import java.util.List;
import java.util.Map;
import java.util.concurrent.ArrayBlockingQueue;
import java.util.concurrent.ConcurrentLinkedQueue;

public class TokenCounterSlave extends AMapReduceTracer implements SlaveInterface {
    private int threadId;
    private List<KeyValue<String, Integer>> keyValueList;
    private TokenCounterModel model;

    public TokenCounterSlave(final int threadId, final TokenCounterModel model) {
        this.threadId = threadId;
        this.model = model;
        this.keyValueList = new ArrayList<>();
    }

    public synchronized void notifySlave() {
    	this.traceNotify();
        this.synchronizedNotify();
    }

    public void splitBoundedBuffer() {
        final ArrayBlockingQueue<KeyValue<String, Integer>> boundedBuffer = this.model.getBoundedBuffer();
        try {
            while(true) {
                this.traceDequeueRequest(boundedBuffer);
                final KeyValue<String, Integer> consumedItem = boundedBuffer.take();
                if (consumedItem.getKey() == null) {
                    break;
                }
                this.traceDequeue(consumedItem);
                this.keyValueList.add(consumedItem);
            }
        } catch (InterruptedException ex) {
            Tracer.error(ex.getMessage());
        }
    }

    public Map<String, Integer> reduceList(final ReducerInterface<String, Integer> reducer, final List<KeyValue<String, Integer>> list) {
        return reducer.reduce(list);
    }

    private ArrayList<ConcurrentLinkedQueue<KeyValue<String, Integer>>> splitReduction(final Map<String, Integer> partiallyReducedMap) {
        final ArrayList<ConcurrentLinkedQueue<KeyValue<String, Integer>>> reduceQueueList = this.model.getReductionQueueList();
        final TokenCounterPartitioner partitioner = TokenCounterPartitionerFactory.getPartitioner();
        for (Map.Entry<String, Integer> entry: partiallyReducedMap.entrySet()) {
            final String key = entry.getKey();
            final Integer value = entry.getValue();
            final int numOfPartitions = reduceQueueList.size();
            final int index = partitioner.getPartition(key, value, numOfPartitions);
            this.tracePartitionAssigned(key, value, index, numOfPartitions);
            final KeyValue<String, Integer> keyValue = new KeyValue<>(key, value);
            reduceQueueList.get(index).add(keyValue);
        }
        return reduceQueueList;
    }

    public void signalQuit() {
        this.traceQuit();
    }

    @Override
    public void run() {
        final TokenCounterBarrier tokencounterBarrier = this.model.getBarrier();
        final ReducerInterface<String, Integer> reducer = ReducerFactory.getReducer();
        while(true) {
            final Map<String, Integer> originalMap = this.model.getResult();
            this.splitBoundedBuffer();
            final Map<String, Integer> partiallyReducedMap = this.reduceList(reducer, this.keyValueList);
            final ArrayList<ConcurrentLinkedQueue<KeyValue<String, Integer>>> reductionQueueList = this.splitReduction(partiallyReducedMap);
            tokencounterBarrier.barrier();
            this.traceSplitAfterBarrier(this.threadId, reductionQueueList);
            for (ConcurrentLinkedQueue<KeyValue<String, Integer>> reductionQueue : reductionQueueList) {
                final List<KeyValue<String, Integer>> keyValues = List.copyOf(reductionQueue);
                this.reduceList(reducer, keyValues);
            }
            final Joiner joiner = this.model.getJoiner();
            joiner.finished();
            this.traceAddedToMap(originalMap, this.model.getResult());
            try {
                this.synchronizedWait();
            } catch (InterruptedException ex) {
                Tracer.error(ex.getMessage());
                break;
            }
        }
    }

    @Override
    public String toString() {
        return AMapReduceTracer.SLAVE;
    }
}

